import React, { useState} from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
    return (
        <>
          <nav className = 'navbar'>
          <div className = 'navbar-container'>
            <Link path = '/' className = 'navbar-logo'>
                PRUDENCE
            </Link>
          </div>

          </nav> 
        </>
    )
}

export default Navbar
